import classes from "./EventsList.module.css";

const EventList = () => {
  return (
    <ul className={classes["events-list"]}>
      {props.movies.map((movie) => (
        <Movie
          key={movie.id}
          title={movie.title}
          releaseDate={movie.releaseDate}
          openingText={movie.openingText}
        />
      ))}
    </ul>
  );
};

export default EventList;
